create table customers (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	gender VARCHAR(50),
	phone VARCHAR(50),
	email VARCHAR(50),
	countrycode VARCHAR(50),
	country VARCHAR(50),
	city VARCHAR(50),
	state VARCHAR(50),
	address VARCHAR(50),
	zipcode VARCHAR(50),
	ssn VARCHAR(50),
	timezone VARCHAR(50),
	currency VARCHAR(50)
);
